import React from 'react';
import "./css/style.css";
import "./css/normaliza.css";
import Nav from './Componentes/Nav.js';
import Footer from './Componentes/Footer.js';
import Main from './Componentes/Main.js';
import Peliculas from './Componentes/Peliculas';
import ListaPeliculas from "./Componentes/ListaPeliculas.js";
import Pelicula from "./Componentes/Pelicula";
import ListaActores from "./Componentes/ListaActores.js";
import Actor from "./Componentes/Actor.js";
import ListaVehiculos from "./Componentes/ListaVehiculos.js";
import ListaNaves from "./Componentes/ListaNaves.js";
import Vehiculo from "./Componentes/Vehiculo.js";
import Nave from "./Componentes/Nave.js";

function App() {
  return (
    <React.Fragment>

      <Nav/>
      <Main>
      <Peliculas/>

      {Object.keys(pelicula).length !== 0 ? (
        <Pelicula datos={pelicula} />
      ) : (
        <p></p>
      )}

      {Object.keys(actores).length !== 0 ? (
        <ListaActores
          datosActores={actores}
          funcion={getDatosActor}
          datos={vehicles}
          funcionVehicle={getVehicles}
          datosNaves={naves}
          funcionNaves={getNaves}
        />
      ) : (
        <p></p>
      )}

      {Object.keys(actor).length !== 0 ? <Actor datos={actor} /> : <p></p>}

      {Object.keys(vehicles).length !== 0 ? (
        <ListaVehiculos datos={vehicles} funcionVehicle={getVehicle} />
      ) : (
        <p></p>
      )}

      {Object.keys(naves).length !== 0 ? (
        <ListaNaves datos={naves} funcionNave={getNave} />
      ) : (
        <p></p>
      )}

      {Object.keys(vehicle).length !== 0 ? (
        <Vehiculo datos={vehicle} />
      ) : (
        <p></p>
      )}

      {Object.keys(nave).length !== 0 ? <Nave datos={nave} /> : <p> </p>} 


      </Main>
      <Footer/>

   </React.Fragment>
  );
};

export default App;
